C1 = C0 \ C1;
RR = [-C1(end-0:end,:);eye(2)];
AM_ind = [3,1];
AM = RR(AM_ind,:);
[V,D] = eig(AM);
V = V ./ (ones(size(V,1),1)*V(1,:));
sols(4,:) = diag(D).';
warning('TODO: Extract remaining variables.');

